import React, { useEffect, useContext } from 'react';
import { BrowserRouter as Router, Route,Routes} from "react-router-dom";



import Home from './Page/Home/Home'
import Update_Tap from './AdminPage/Update-Tap/Update-Tap';
import AddProduct from './AdminPage/AddProduct/AddProduct';
import Products from './Productes/Products';
// import { useContext, useEffect } from "react";


function App() {

  return (
    <div>
      <Router>
        <Routes>
          <Route exact path="/" element={<Home />} />
          <Route path="/products/:id" element={<Products />} />
          <Route path='/whyadmin' element={<Update_Tap />} />
          <Route path='/whyadmin/addproduct' element={<AddProduct/>}/>
        </Routes>
      </Router>

    </div>
  );
}

export default App;
